import React, { useState } from 'react';
import './dashboard.css';

const Dashboard = () => {
  const [activeTab, setActiveTab] = useState('dashboard');
  const [sidebarOpen, setSidebarOpen] = useState(false);

  const menuItems = [
    { id: 'dashboard', name: 'Dashboard', icon: 'üìä' },
    { id: 'products', name: 'Productos', icon: 'üì¶' },
    { id: 'users', name: 'Usuarios', icon: 'üë•' },
    { id: 'sales', name: 'Ventas', icon: 'üí∞' },
    { id: 'settings', name: 'Configuraci√≥n', icon: '‚öôÔ∏è' }
  ];

  const statsData = [
    { title: 'Total Usuarios', value: '1,234', change: '+12%', color: 'text-blue-400', bgColor: 'bg-blue-900' },
    { title: 'Ventas Totales', value: '$45,678', change: '+8%', color: 'text-green-400', bgColor: 'bg-green-900' },
    { title: 'Productos', value: '567', change: '+3%', color: 'text-purple-400', bgColor: 'bg-purple-900' },
    { title: 'Pedidos', value: '89', change: '+15%', color: 'text-yellow-400', bgColor: 'bg-yellow-900' }
  ];

  const recentProducts = [
    { id: 1, name: 'Camiseta Urbana', price: '$20', stock: 45, status: 'Disponible' },
    { id: 2, name: 'Camiseta Oversize', price: '$30', stock: 23, status: 'Disponible' },
    { id: 3, name: 'Gorra Negra', price: '$15', stock: 12, status: 'Bajo Stock' },
    { id: 4, name: 'Chaqueta Premium', price: '$45', stock: 8, status: 'Bajo Stock' },
    { id: 5, name: 'Pantal√≥n Casual', price: '$35', stock: 0, status: 'Agotado' }
  ];

  const getStatusColor = (status) => {
    switch (status) {
      case 'Disponible': return 'text-green-400 bg-green-900';
      case 'Bajo Stock': return 'text-yellow-400 bg-yellow-900';
      case 'Agotado': return 'text-red-400 bg-red-900';
      default: return 'text-gray-400 bg-gray-900';
    }
  };

  return (
    <div className="dashboard-container">
      {/* Sidebar backdrop */}
      {sidebarOpen && <div className="mobile-backdrop" onClick={() => setSidebarOpen(false)} />}

      {/* Sidebar */}
      <div className={`sidebar ${sidebarOpen ? 'open' : ''}`}>
        <div className="logo">
          <span className="text-2xl">üöÄ</span>
          <span className="text-xl font-bold text-white">Mi Dashboard</span>
        </div>

        <nav className="menu">
          {menuItems.map(item => (
            <button
              key={item.id}
              onClick={() => {
                setActiveTab(item.id);
                setSidebarOpen(false);
              }}
              className={`menu-item ${activeTab === item.id ? 'active' : ''}`}
            >
              <span className="icon">{item.icon}</span>
              <span>{item.name}</span>
            </button>
          ))}
        </nav>

        <div className="user-profile">
          <div className="avatar">U</div>
          <div>
            <p className="name">Usuario Admin</p>
            <p className="email">admin@empresa.com</p>
          </div>
        </div>
      </div>

      {/* Main Content */}
      <div className="main">
        <header className="header">
          <button onClick={() => setSidebarOpen(true)} className="menu-toggle">‚ò∞</button>
          <h1 className="page-title">
            {activeTab === 'dashboard' ? 'Panel Principal' : activeTab}
          </h1>
          <div className="header-actions">
            <button className="notification-btn">üîî<span className="notification-dot" /></button>
            <button className="logout-btn">Cerrar Sesi√≥n</button>
          </div>
        </header>

        <main className="main-content">
          <div className="alert">‚ö†Ô∏è ¬°Atenci√≥n! Hay nuevas tareas pendientes por revisar.</div>

          <div className="stats-grid">
            {statsData.map((stat, index) => (
              <div key={index} className="stat-card">
                <div className="stat-header">
                  <div>
                    <p className="stat-title">{stat.title}</p>
                    <p className="stat-value">{stat.value}</p>
                  </div>
                  <div className={`stat-icon ${stat.bgColor} ${stat.color}`}>üìà</div>
                </div>
                <div className="stat-footer">
                  <span className="stat-change">{stat.change}</span>
                  <span className="stat-compare">vs √∫ltimo mes</span>
                </div>
              </div>
            ))}
          </div>

          <div className="content-grid">
            <div className="products-card">
              <div className="card-header">
                <h2>Productos Recientes</h2>
                <button className="view-all">Ver todos</button>
              </div>
              <table className="products-table">
                <thead>
                  <tr>
                    <th>Producto</th>
                    <th>Precio</th>
                    <th>Stock</th>
                    <th>Estado</th>
                  </tr>
                </thead>
                <tbody>
                  {recentProducts.map(product => (
                    <tr key={product.id}>
                      <td>{product.name}</td>
                      <td>{product.price}</td>
                      <td>{product.stock}</td>
                      <td>
                        <span className={`status-badge ${getStatusColor(product.status)}`}>
                          {product.status}
